import { NavLink, Outlet, Suspence } from 'react-router-dom';

const Layout = () => {
  return (
    <header>
      <ul>
        <li>
          <NavLink to="/">Home</NavLink>
        </li>
        <li>
          <NavLink to="/movies">Movies</NavLink>
        </li>
      </ul>
      <main>
        <Outlet />
      </main>
    </header>
  );
};

export default Layout;
